const { render } = require("@testing-library/react");

function navBar() {
    const items = [{name: "Home", id: "Body"}, 
                    {name: "Education", id: "Education"}, 
                    {name: "Experience", id: "Experience"}, 
                    {name: "Projects", id: "Projects"}];
    return (
        <div>
            <ul id = "nav" style={navCSS}>
                {items.map(item => (
                    <li key={item}>
                        <a href={'#'+item.id} style={{color: "#0b4fba"}}>{item.name}</a>
                    </li>
                ))}
            </ul>
        </div>
    )
}

const navCSS = {
    width: "100%",
    margin: "0 0 0 0",
    display: "flex",
    flexDirection: "row",
    listStyle: "none",
    backgroundColor: "white"
}
//053685

const navItemCSS = {
    display: "block",
    padding: "4px 8px",
    margin: "10px",
    fontSize: "20px",
    textDecoration: "none",
    color: "#0b4fba" 
}

export default navBar;
